tables.table_schema:
CREATE TABLE CloudCoverData (
  date DATE NOT NULL,
  cloud_cover FLOAT NOT NULL
);

CREATE TABLE cloud_cover_data (
  id INT PRIMARY KEY,
  date DATE,
  time TIME,
  cloud_coverage FLOAT
);

CREATE TABLE forecast_data (
  id INT PRIMARY KEY,
  forecast_date DATE,
  forecast_time TIME,
  predicted_cloud_coverage FLOAT
);

CREATE TABLE weather_station_info (
  station_id INT PRIMARY KEY,
  station_name VARCHAR,
  location VARCHAR,
  elevation INT
);

CREATE TABLE cloud_cover_data (
    id INT PRIMARY KEY,
    date DATE,
    location VARCHAR(50),
    cloud_cover_percentage FLOAT
);

CREATE TABLE weather_stations (
    id INT PRIMARY KEY,
    station_name VARCHAR(50),
    latitude FLOAT,
    longitude FLOAT
);

CREATE TABLE weather_models (
    id INT PRIMARY KEY,
    model_name VARCHAR(50),
    description TEXT
);

CREATE TABLE weather_data_sources (
    id INT PRIMARY KEY,
    source_name VARCHAR(50),
    url VARCHAR(255)
);
